[PixAndVideo] Kitty Lovedream (The new model / 200537 / 03.31.2015)

Kitty signed up to a model agency, because she wants to be a model. It is the day of the audition and she waits for her turn, obviously very nervously. Then Lauro, one of the agency representative shows up and offers to say a good word or two for the girl. Of course it has a price... something that Kitty has to pay with her... kitty.

